import axios from 'axios';

const API = axios.create({
    baseURL: 'https://pixabay.com/api/?key=19709901-80994e93db9f1c81fea16099c&q=yellow+flowers&image_type=photo&pretty=true',
    header:{
       Accept: 'application/json',
       'Content-type': 'application/json' 
    }, 
    params: {
        key: process.env.PIXABAY_API_KEY
    },
})

export default API;
